		<SCRIPT>
        function passWord() {
        var testV = 1;
        var pass1 = prompt('Enter Password',' ');
        while (testV < 3) {
        if (!pass1) 
        history.go(-1);
        if (pass1.toLowerCase() == "towbin2018") {
        alert('You Got it Right!');
        break;
        } 
        testV+=1;
        var pass1 = 
        prompt('Access Denied - Password Incorrect, Please Try 					Again.','Password');
        }
        if (pass1.toLowerCase()!="password" & testV ==3) 
        history.go(-1);
        return " ";
        } 
        window.onload = passWord();
        </SCRIPT>
